    "id00260_app:vote:abs_adicional:body": "<p>En relación con las propuestas de acuerdo no formuladas por el Consejo de Administración o sobre puntos no incluidos en el orden del día, marque la casilla NO siguiente si no autoriza la delegación (en cuyo caso se entenderá que el accionista se abstiene en relación con dichas propuestas de acuerdo).</p>",
    "id00261_app:vote:sustitucion:body": "<p>A los efectos de lo dispuesto en los artículos 523 y 526 de la Ley de Sociedades de Capital (LSC), se informa de que el Presidente del Consejo, así como cualquier otro miembro del Consejo de Administración, puede encontrarse en conflicto de intereses. Si el representado no hubiera impartido instrucciones de voto precisas, la representación, salvo indicación expresa en contrario a continuación, se entenderá conferida, solidaria y sucesivamente, al Secretario del Consejo de Administración o al Vicesecretario del Consejo de Administración. Marque la casilla NO siguiente sólo si no autoriza la sustitución (en cuyo caso se entenderá que el accionista instruye al representante para que se abstenga):</p>",
