    "id00275_home:app:pendiente:text"       : "Sr./Sra. Accionista,<br/><br/>Le informamos que su alta en el sistema está pendiente de ser validada.<br/>Tan pronto haya sido revisada y confirmada, recibirá un email indicándole que ya podrá acceder a la plataforma.<br/><br/>Cordialmente,<br/><br/>El Administrador",
