    "id00280_app:foro:adhesion_error:modal:title": "Error",
    "id00281_app:foro:adhesion_error:modal:body" : "No es posible adherirse a una oferta/petición de representación si ya se cuenta con una o se está adherido.",
    "id00282_app:foro:dashboard:title"   : "Bienvenido/da, ",
    "id00283_app:foro:dashboard:subtitle": "al Foro Electrónico de %%empresa%%",
    "id00284_app:foro:dashboard:body"    : "<p>Siguiendo las disposiciones de la \"Ley de Sociedades de Capital\", esta plataforma ha sido dispuesta para que pueda ejercer sus derechos de participación.</p><p>Como se define en las diferentes opciones, podrá:</p><ol><li>Presentar sus propuestas</li><li>Presentar sus iniciativas</li><li>Presentar sus ofertas o peticiones de representación, o</li><li>Adherirse a las presentadas por otros accionistas</li></ol><p>Los menús que se presentan en el lado izquierdo de la pantalla, están agrupados de forma que pueda acceder a las acciones realizadas por otros accionistas (públicas) <i class=\"fa fa-users\"></i>, a las que vd. haya creado (personales) <i class=\"fa fa-user\"></i> y por último la que le permitirá crearlas de forma explícita <i class=\"fa fa-pencil-square-o\"></i>.</p><p>Este es un foro moderado, lo que significa que las opciones llevadas a cabo por los accionistas, serán revisadas por el administrador de la plataforma, conforme a lo establecido en el reglamento del mismo. Dentro del horario comprendido entre las 09:00h y las 18:00h de Lunes a Jueves y los Viernes de 09:00h a 15:00h.</p>",
    "id00285_app:foro:info:modal:title": "Información",
    "id00286_app:foro:offer:info:modal:body"   : "Contenido",
    "id00287_app:foro:request:info:modal:body" : "Contenido",
