    "id00289_app:voto:modal:previousaction:continue": "Continuar",
    "id00290_app:voto:modal:previousaction:cancel"  : "Cancelar",
    "id00291_app:voto:welcome:title"    : "Bienvenido/da, ",
    "id00292_app:voto:welcome:subtitle" : "al Voto/Delegación Electrónica de %%empresa%%",
    "id00293_app:voto:welcome:body"     : "<p>Siguiendo las disposiciones de la \"Ley de Sociedades de Capital\", esta plataforma ha sido dispuesta para que pueda ejercer sus derechos de participación.</p><p>Desde la misma podrá Delegar sus acciones o Votar electrónicamente, según se muestran en las opciones del asistente.</p><p>Las opciones que se presentan en el lado izquierdo de la pantalla, corresponden al punto del asistente en el que vd. se encuentra.</p><p>En la parte inferior derecha de la pantalla se muestra los botones de navegación.</p><p>A través de este asistente podrá delegar su representación o votar en la Junta de Accionistas. En la última pantalla se le pedirá que confirme el proceso, el que generará el registro en nuestra base de datos y usted recibirá un correo electrónico de confirmación, donde podrá ver las acciones que haya registrado.</p><p>Finalmente, ha de tener en cuenta que su asisténcia física a la Junta de Accionistas, o la alienación de sus acciones que tuviera conocimiento la Sociedad antes de la celebración de la Junta en primera convocatória, anularán el voto o delegación que haya podido realizar a través de Internet (o mediante cualquier otro medio de comunicación a distancia).</p><p>Para iniciar el proceso, haga clic en el botón \"Siguiente\".</p>",
    "id00294_app:foro:adhesion:disabled": "No es posible adherirse a una %%item%% si ya existe una propia o una adhesion a estas.",
    "id00295_app:foro:adhesion:offer"  : "oferta",
    "id00296_app:foro:adhesion:request": "petición",
    "id00297_home:app:retornar:title": "Retornar accionistas",
    "id00298_home:app:retornar:message" : "La documentación y/o datos no han sido completados.<br/>Por favor, revíselos conforme a lo que la haya indicado el administrador y vuelva a enviar el registro en la plataforma para que pueda ser dado de alta en la misma.",
    "id00299_app:representation:atencion": "Atención",
    "id00300_app:voto:shares:body": "<p>Por favor, introduzca el número de acciones de la Sociedad de las que usted es titular, si éste es diferente del que indicó cuando realizó el registro en la Plataforma. Este dato será verificado con posterioridad contrastándolo con el que figure en el \"Libro de Accionistas\" , siendo éste último el que será considerado como válido por la Sociedad de conformidad con la normativa vigente.</p>",
