    "id00310_app:voto:sustitution": "Sustitución",
    "id00311_app:voto:delegation:body": "<h3>A continuación debe seleccionar en quién desea delegar</h3><p>Se entenderá que usted autoriza a la persona en la que usted delegue su representación a que vote en aquellos asuntos que, aún no figurando en el Orden del día, puedan ser sometidos a la votación en la Junta General de Accionistas. En este caso el representante ejercerá el voto en el sentido que estime más favorable para los intereses del accionista representado, salvo que usted nos indique lo contrario en el apartado \"Contactar\", el icono con forma de sobre situado en la parte superior de la presente Plataforma, indicando su nombre y dirección de correo electrónico</p>",
