    "id00320_app:voto:instructions"     : "Instrucciones de voto/delegación",
    "id00321_app:voto:instructions:body": "<h3>¿Desea indicar instrucciones de voto?</h3><p>En el supuesto de delegación de la representación en el Presidente del Consejo de Administración, así como en otros consejeros a los que sea de aplicación el régimen de solicitudes públicas de representación, si usted no indica instrucciones expresas de voto, se entenderá que éste votará a favor de las propuestas de acuerdos formuladas por el Consejo de Administración.</p>",
    "id00322_app:voto:instructions:yes" : "Sí",
    "id00323_app:voto:instructions:no"  : "No",
    "id00324_app:voto:voto"   : "Votación",
    "id00325_app:voto:body:vote": "<p>A continuación indique sus instrucciones de voto.</p><p>Puede hacerlo globalmente desde las opciones que aparecen después de estos comentarios o individualmente a cada punto.</p><p>En el caso de que usted no indique instrucciones de voto en relación a uno o varios puntos del Orden del día, se entenderá que, para esos puntos del Orden del día, usted vota a favor de las propuestas formuladas por el Consejo de Administración.</p><p>En el supuesto de delegación de la representación en el Presidente del Consejo de Administración, así como en otros consejeros a los que sea de aplicación el régimen de solicitudes públicas de representación, si usted no indica instrucciones expresas de voto, se entenderá que éste votará a favor de las propuestas de acuerdos formuladas por el Consejo de Administración.</p>",
