    "id00374_app:derecho:dashboard:subtitle": "al Derecho de Información de %%empresa%%",
    "id00375_app:derecho:dashboard:body"    : "<p>Siguiendo las disposiciones de la \"Ley de Sociedades de Capital\", esta plataforma ha sido dispuesta para que pueda ejercer sus derechos de participación.</p><p>Como se define en las diferentes opciones, podrá:</p><ol><li>Crear Solicitudes</li><li>Ver solicitudes publicas</li><li>Ver comunicados emitidos por la entidad</li></ol><p>Los menús que se presentan en el lado izquierdo de la pantalla, están agrupados de forma que pueda acceder a las acciones realizadas por otros accionistas (públicas) <i class=\"fa fa-users\"></i>, a las que vd. haya creado (personales) <i class=\"fa fa-user\"></i> y por último la que le permitirá crearlas de forma explícita <i class=\"fa fa-pencil-square-o\"></i>.</p><p>Este es una plataforma moderada, lo que significa que las opciones llevadas a cabo por los accionistas, serán revisadas por el administrador de la plataforma, conforme a lo establecido en el reglamento del mismo. Dentro del horario comprendido entre las 09:00h y las 18:00h de Lunes a Jueves y los Viernes de 09:00h a 15:00h.</p>",
