    "id00398_home:app:requeriments:text": "<p>Los requisitos mínimos recomendados para esta aplicación son los siguientes:</p><ul><li>Internet Explorer 9 o superior</li><li>Mozilla Firefox 3 o superior </li><li>Google Chrome 10 o superior</li></ul><p>El uso de otros productos o versiones de exploradores anteriores no garantiza el funcionamiento idóneo de la aplicación.</p><p>Si utiliza el DNI electrónico, es necesario que tenga bien configurado el lector, disponga del PIN y haya instalado el programa facilitado por el Ministerio del Interior desde su página del DNI electrónico.</ul>",
