    "id00413_app:voto:body:delegate": "<p>A continuación indique sus instrucciones de voto.</p><p>Puede hacerlo globalmente desde las opciones que aparecen después de estos comentarios o individualmente a cada punto.</p><p>En el caso de que usted no indique instrucciones de voto en relación a uno o varios puntos del Orden del día, se entenderá que, para esos puntos del Orden del día, usted vota a favor de las propuestas formuladas por el Consejo de Administración.</p><p>En el supuesto de delegación de la representación en el Presidente del Consejo de Administración, así como en otros consejeros a los que sea de aplicación el régimen de solicitudes públicas de representación, si usted no indica instrucciones expresas de voto, se entenderá que éste votará a favor de las propuestas de acuerdos formuladas por el Consejo de Administración.</p>",
