    "id00443_app:av:body:vote": "<p>A continuación indique sus instrucciones de voto.</p><p>Puede hacerlo globalmente desde las opciones que aparecen después de estos comentarios o individualmente a cada punto.</p><p>En el caso de que usted no indique instrucciones de voto en relación a uno o varios puntos del Orden del día, se entenderá que, para esos puntos del Orden del día, usted vota a favor de las propuestas formuladas por el Consejo de Administración.</p>",
