    "id00447_app:av:welcome:body"     : "<p>Desde este asistente, podrá votar de forma explícita a las propuestas presentadas por el Consejo de Administración.</p><p>Utilice los botones de navegación, para ir avanzando y completar todo el proceso de votación.</p>p>En la última pantalla, deberá confirmar el proceso, después de verificar los datos de su votación. Si algún dato no corresponde a lo que quería hacer, puede volver hacia atrás, para corregirlo.</p><p>Al finalizar la votación recibirá un email de confirmación en su cuenta de correo.</p>",
