    "id00498_app:av:new-leave": "Registro de salida",
    "id00499_app:av:leave:body": "<p>Conforme a lo que establece la ley, si confirma su propósito de abandonar la reunión, su salida quedará registrada en el sistema.</p><p>Si su abandono se produce antes de que se cierre el proceso de votaciones, significará que no quiere que sus acciones se computen en el quórum de votaciones, por lo que serán anuladas en su totalidad.</p><p>Deberá confirmar dicha acción, marcando la casilla \"Acepto que abandono\" y haciendo clic en el botón \"Guardar\".</p>",
    "id00500_app:av:new-leave:confirm":"Guardar",
    "id00501_app:av:leave:privacy-policy":"Acepto que abandono",
