    "id00503_app:av:dashboard:title"    : "Instrucciones, ",
    "id00504_app:av:dashboard:subtitle" : "de uso para la Asistencia Virtual de %%empresa%%.",
    "id00505_app:av:dashboard:body"     : "<p>Esta plataforma ha sido dispuesta para que pueda ejercer sus derechos de participación durante el desarrollo de la Junta.</p><p>Le informamos que si había accedido previamente al Voto/Delegación Electrónica, al haberse registrado en la Asistencia Virtual, lo que hizo en dicha plataforma ha quedado anulado.</p><p>Al acceder a la Asistencia Virtual, sus acciones se han votado, por defecto, \"A favor\" de las propuestas del Consejo.</p><p>Para cambiar su votación deberá hacerlo de forma explicita desde esta plataforma. </p><p>Las opciones que se presentan en el lado izquierdo de la pantalla, le permitirán:</p><ul><li>Intervenir en la junta, pulsando sobre el botón \"<strong>Crear Ruegos y Preguntas</strong>\", o</li><li>Votar, pulsando sobre el botón \"<strong>Votación</strong>\"</li></ul>",
